def StringListIntoList(StringList,brakets=True,Splitter=", ",SingleListCutAmount=1,DoubleListCutAmount=3,DoublesSeparator1="'], ['", DoublesSeparator2="', '",DoubleList=False):
    

    if DoubleList:
        StringList=StringList[DoubleListCutAmount:-DoubleListCutAmount]
        
        # print(StringList)
        # print('StringList step1')

        separator1=DoublesSeparator1

        StringList=StringList.split(separator1)

        # print(StringList)
        # print('StringList step2')

        StringListofLists=[]

        if len(StringList)>1:

            for i in range(len(StringList)):
                separator2=DoublesSeparator2

                # print(StringList[i])

                # print('StringList[i] 1 above')

                

                StringList[i] = StringList[i].replace("'", "")

                StringList[i] = StringList[i].replace('"', '')



                StringList[i]=StringList[i].split(separator2)

                # print(StringList[i])

                # print('StringList[i] 2 above')

                if StringList[i]=="''":
                    StringList[i]=''
                
                if StringList[i]=='""':
                    StringList[i]=''

                
                
                

                
                # print(StringList[i])

                # print('StringList[i] 3 above')




                StringListofLists.append(StringList[i])

                # ListofValuesListOfList.push(row[i])

            # print(StringListofLists)

        else:
            separator2=DoublesSeparator2

            # print(StringList[0])


            StringList[0] = StringList[0].replace("'", "")

            StringList[0] = StringList[0].replace('"', '')



            StringList=StringList[0].split(separator2)

            # print(StringList)
            
            # print('StringList else after separator2')

            for i in range(len(StringList)):
                # if StringList[i]=="''" or '""':
                #     StringList[i]=''

                if StringList[i]=="''":
                    StringList[i]=''
                
                if StringList[i]=='""':
                    StringList[i]=''
                
                

            # print(StringList)
            
            # print('StringList else after quote removal')

            # print(StringList[0])
            
            # print('StringList[0] else after quote removal')



            StringListofLists=StringList



        StringList=IfSingleListMakeDoubleList.IfSingleListMakeDoubleList(List=StringListofLists)

        # StringList=StringListofLists

    else:
        if brakets:
            StringList=StringList[SingleListCutAmount:-SingleListCutAmount]

        StringList=StringList.replace("'","")
        StringList=StringList.replace('"',"")

        StringList=StringList.split(Splitter)
   

    return StringList



